import React from 'react';
import { Button, Typography, Paper } from '@mui/material';

const PickupPage = () => {
  return (
    <div style={{ padding: '2rem', display: 'flex', justifyContent: 'center', backgroundColor: '#325636', color: '#FFFFFF' }}>
      <Paper elevation={3} sx={{ width: '50%'}}>
        <Typography variant='h5' sx={{ fontWeight: 'bold'}}>Store Details</Typography>
      </Paper>
    </div>
  );
};

export default PickupPage;
